import React from 'react'

import classes from './Mapa.module.css';

function Mapa(props) {
    const rutas=props.routes.map((_,i)=>{
    return <div className={classes.etapa}>{i+1}</div>
    })
    return (
        <div className={classes.Mapa}>
            {rutas}
        </div>
    )
}

export default Mapa;
